import API from './api';

const getUsers = async () => {
  const res = await API.get('/users');
  return res.data;
};

const deleteUser = async (id) => {
  const res = await API.delete(`/users/${id}`);
  return res.data;
};

const usersService = {
  getUsers,
  deleteUser,
};

export default usersService;
